import React from 'react';
import { Button } from 'semantic-ui-react'

export default class NavigationBar extends React.Component{
    render(){
        return(
            <div>
             <Button primary>Primary</Button>
             <Button secondary>Secondary</Button>
            </div>
        )}

}
